import React from 'react';
import ReactDom from 'react-dom';

const el = (
    <div>
        <h1>My TodoList</h1>
        <input type="search"/>
        <ul>
            <li>Learn React</li>
            <li>Build App</li>
        </ul>
    </div>
)

ReactDom.render(el, document.getElementById('root'));
